article_content:
상품은 예쁘고 조립도 쉬운데.
원목특성상 못을 박다가 쪼개지네요^^;;;
귀찮기도하구 예뻐서 그냥 써요.^^

박스포장도 엉망이고 유리도 얼굴덜룩한게 더럽게 왔어요
그냥 닦아서 쓰면 되니까 여기까지는 괜찮았는데 나무 이어지는 부분도 부러져 있고 포장 하나하나 뜯는데 손에 먼지가 ;
나사로 조립하면 사용하는데에는 큰 이상은 없을거같아서 환불하기 귀찮아서 그냥 쓰려구요 이런 택배 첨 받아봐요 ;;
그냥 진짜 싼맛에 인테리어용으로만 몇개월쓰다 버려도 괜찮은 분들만 사세요 리얼 후기

빠른 배송도 정말 좋고요~
침대 옆에 두기에 크기도 아주 딱 알맞습니다.
별 하나를 뺀것은 서랍 속에 염색물이 자꾸 묻어나와 20번은 닦은 것과 새 가구 냄새가 다소 오래가서 입니다.;;
공정 과정에서 어쩔 수 없는 것일 수도 있지만요 ^^;;
그래도 정말 좋습니다~ 감사합ㄴㅣ다^^

가격대비 좋으시다고 하시네요.친정엄마 침대 옆 협탁으로
사드렸는데. 20900원짜리가 어쩜 튼튼하고 좋니 라고. 하시네요
전 못 봐서 모르겠어요~^^:;;

맘에듬 협탁 싸이즈라 침대옆에 놓으면 딱이겠지만
난 복층이라 매트리스 옆에 놓기엔 높아서;;;
걍 쓰고 있음

침대가 높이65cm정도됩니다 협탁을두자니 기존협탁들이 너무 낮아 찾던중 이걸로 샀네요 사이즈도적당하고 서랍도있어만족합니다

그런데 서랍안쪽은 별다른 마감처리가 안되어 있으니 뭔갈깔아주시는게 좋아요

그리고 저렴이 답게 냄새는납니다^^;;

일요일 오후(3-4시 사이)에 주문했는데 담 날인 월욜 아침에 도착했네요;;;

로켓배송에 정말 놀랐어요~~지방이라 화욜 배송 예정일 줄 알았는데..

상품도 하자 없는 걸로 받았고, 배송에 또 한번 놀랐고..

와~ 뽁뽁이 한장없이 박스에 덜렁 넣어져 오네요;
그래도 어디 파손된 곳없이 잘왔고
가성비 좋아요 디자인 심플하니 예뻐요

다리한쪽 고정하는게 못이 덜박혀왔네요ㅋㅋ;
그래도 어디 부셔져오진않아서 걍쓸라구여^^
상품은 깔끔하니 나름 괜찮습니당~

이거 서랍 다리가 세번째 서랍안에 들어가있더라고요?
처음엔 모르고 그냥 침대옆에 두고 썼는데,,, 나중에 발견함;
근데 뭐 저는 다리 안낀게 높이가 맞아서 그냥 썼네요 튼튼하고 괜찬아요

서랍안은 눈가리개입니까..
합판이라 영 재질 나빠보이고 겉과속 넘 달라요;;
파랑이 없어서 연두 샀는데 울집 가구들 색상과는 안어울려서 역시 별루네요

협탁 다리가 2개는 맞고 2개는 안맞고
교환해서 왔는데 이번엔 아에 밑에 다리발고정하는게 없고;;
겨우겨우 교환전품이랑 박스다뜯어서 맞춰서 다리껴놓고 근데 서랍은 다틀어져있고;; 다신 쿠팡에서 가구안살꺼같아여 그전에 화장대 구매했을때도 안좋은거왔었는데 이번에도;;

아..사고보니 일제였네 ㅠㅠ
물론 일제답게 제품은 좋음;;
근데 알았으면 안샀을거임.

상품이 망가져서 왔네요
솔직히 돈 주고 샀는데
이렇게 오니 기분 나쁘네요;;;

비닐 뜯으니까 뚝떨어져서 발등 찍혔어요
귀찮아서 그냥쓸라구요
본드로칠해야할지 맨위에 서랍은 아예 못쓴다 생각해야할지..;;;
